(294, 'LA vida te pone en el camino que transitas las oportunidades que mereces, es nuestra responsabilidad tomarlas.', '3', 3, '1', 1, 0, 1),
(428, 'Aprendemos más con las malas experiencias que con las buena, no es masoquismo, es que lo que afecta lo razonamos mas.', '141013510', 3, '141013510', 0, 0, 0),
(451, 'Cloud es un ¡SERVICIO GRATUITO! http://pkcut.net/l/1e8ga0l ', '2601729422', 23, '2601729422', 0, 0, 0),
(452, 'EL MEJOR MEDIO PARA LA COMPRA Y VENTA\n\nhttp://pkclick.com/', '2601729422', 23, '2601729422', 0, 0, 0),
(453, '500 GB DE MEMORIA ON-LINE \n\nhttp://www.pkcut.net/l/1swo10p', '2601729422', 23, '2601729422', 0, 0, 0),
(482, 'No dejamos de jugar porque envejecemos, sino que envejecemos porque dejamos de jugar', '32', 3, '32', 1, 0, 1),
(487, 'asasasasasa', '32', 3, '32', 2, 0, 1),
(488, 'sasasasas', '32', 3, '32', 3, 0, 1),
(489, 'dsdsdsdsds', '32', 3, '32', 4, 0, 1),
(495, 'No hay que dejar que un estado de animo negativo afecte el resto de tus momentos, es posible estar triste y sonreír con alegría.', '141013510', 3, '141013510', 0, 0, 0),
(496, 'Maduramos mejor con las experiencias que con los años. #UnaVidaPk ', '141013510', 3, '141013510', 0, 0, 0),
(503, 'Es mejor ser odiado por aquello que somos, que ser amados por la máscara que llevamos. #RT \nJim Morrison ', '141013510', 3, '141013510', 0, 0, 0),
(504, 'Ninguna vida está completa sin un toque de locura \nPaulo Coelho ', '141013510', 3, '141013510', 0, 0, 0),
(508, 'No encuentro palabras para explicar lo que me haces sentir, tal vez, las palabras no tienen sentido cuando el amor dice sus primeras letras', '141013510', 3, '141013510', 0, 0, 0),
(509, 'Uno es dueño de lo que calla, y esclavo de lo que habla.\nSigmund Freud', '141013510', 3, '141013510', 0, 0, 0),
(510, 'Cuando la vida te sepa amarga, endúlzala con una sonrisa.', '141013510', 3, '141013510', 0, 0, 0),
(511, 'Sentirse solo puede ser el resultado de la ausencia fí­sica de alguien o por carencia de afecto en tu vida.', '141013510', 3, '141013510', 0, 0, 0),
(512, 'Seguir a pesar de todo es lo que te hace diferente a los demás. @Proyectokmila #UnaVidaPk', '141013510', 3, '141013510', 0, 0, 0),
(513, 'En la vida hay que saber pasar página,cerrar libros y a veces hasta clausurar bibliotecas', '141013510', 3, '141013510', 0, 0, 0),
(514, 'El respeto se gana, la honestidad se aprecia, la confianza se adquiere, y la lealtad se devuelve', '141013510', 3, '141013510', 0, 0, 0),
(515, 'Nunca llores por una persona, nadie absolutamente nadie se merece tus lágrimas', '141013510', 3, '141013510', 0, 0, 0),
(516, 'Nadie te impide abrir el baul de tus sueños, porque la llave del destino solo la guardas tú', '141013510', 3, '141013510', 0, 0, 0),
(517, 'Siempre conoce a la persona, antes de entregar tu corazón muchos son aprovechados y no valoran el amor', '141013510', 3, '141013510', 0, 0, 0),
(518, '"El fracaso derrota a los perdedores e inspira a los ganadores".\nRobert T. Kiyosaki\n#RT #FF\n', '141013510', 3, '141013510', 0, 0, 0),
(519, '"La única parte donde el ÉXITO aparece antes que el TRABAJO es en el diccionario".\nVidal Sasoon \n#RT #FF\n', '141013510', 3, '141013510', 0, 0, 0),
(520, 'Algunos sueñan con ser grandes, mientras que en @Proyectokmila somos grandes cada dÃ­a #UnaVidaPk #RT #FF', '141013510', 3, '141013510', 0, 0, 0),
(521, '"Tu tiempo es limitado. No lo desperdicies viviendo el sueño de otra persona"\nSteve Jobs\n#RT #FF', '141013510', 3, '141013510', 0, 0, 0),
(525, 'Compartir contigo ha sido divertido, trabajar contigo animado, y todo lo que conozco de ti me gusta y quiero seguir descubriendote', '141013510', 3, '141013510', 0, 0, 0),
(527, '#RT No hay manual para ser Feliz! #SiguemeyteSigo', '2282821242', 2, '2282821242', 41, 1, 1),
(528, 'Un vaso medio vacío de vino es también uno medio lleno, pero una mentiras a medias, de ningún modo es una media verdad', '2282821242', 2, '2282821242', 42, 1, 1),
(529, 'Formarse no es nada fácil, pero reformarse lo es menos aún. Se Profesional con @Itadvisor_ve #FF', '2282821242', 2, '2282821242', 43, 1, 1),
(530, 'Mi pesimismo no es sino una variedad del optimismo. #PoeTuit', '2282821242', 2, '2282821242', 44, 1, 1),
(531, 'No es como empieces si no como lo termines! #Siguemeytesigo', '2282821242', 2, '2282821242', 45, 1, 1),
(532, 'Para obtener resultados diferentes. Necesitas ademas de actuar diferente! Estar convencido de tu idea! Consejo de #Marketing ', '2282821242', 2, '2282821242', 46, 1, 1),
(533, 'Lo que los demás te reprochan, cultivarlo \n\nEso eres tú.\n\n#SiguemeyteSigo\n#Fav\n#RT', '2282821242', 2, '2282821242', 47, 1, 1),
(534, 'Haz que tus publicaciones y tweets sean eficientes con esta aplicacion gratuita! \nhttp://www.pkcut.net/l/1tuoh99\n#SocialMediaMarketing\n#RT', '2282821242', 2, '2282821242', 48, 1, 1),
(535, 'Dios no habría alcanzado nunca al gran público sin ayuda del diablo. de igual forma trabaja el #Marketing', '2282821242', 2, '2282821242', 49, 1, 1),
