(3775, 'En la escuela, la maestra dice:\n- A ver Luis, ¿cómo te imaginas la escuela ideal?\n- ¡Cerrada, maestra! #siguemeytesigo', '2456756244', 1, '2456756244', 175, 0, 1),
(3776, 'Acuario:Te estás preparando para una competición deportiva.Además de entrenar varias horas al día deberías cuidar tu alimentación.', '2456756244', 1, '2456756244', 176, 0, 1),
(3777, 'Piscis:Deberías buscar una actividad intelectual que te mantenga entretenido por las tardes. ', '2456756244', 1, '2456756244', 177, 0, 1),
(3778, 'Aries:En ocasiones no te gusta hacer deporte, pero deberías buscar alternativas para hacer algo de ejercicio. ', '2456756244', 1, '2456756244', 178, 0, 1),
(3779, ' Tauro:Tienes un dinero ahorrado. Lo mejor es que lo inviertas en un piso o en un local. ', '2456756244', 1, '2456756244', 179, 0, 1),
(3780, 'Géminis: Por la noche te costará conciliar el sueño. Le darás muchas vueltas a unos trámites que tienes que realizar mañana. ', '2456756244', 1, '2456756244', 180, 0, 1),
(3781, 'Cáncer: Si algo te funciona bien no deberías cambiarlo. Es probable que compres un producto nuevo que te resultará más barato. ', '2456756244', 1, '2456756244', 181, 0, 1),
(3782, ' Leo:Te gusta un determinado corte de pelo, pero te costaría mucho mantenerlo. ', '2456756244', 1, '2456756244', 182, 0, 1),
(3783, 'Virgo:Aunque ahora te encuentres bien de salud, deberías dejar cualquier adicción que te persiga, ya sea el tabaco o el alcohol. ', '2456756244', 1, '2456756244', 183, 0, 1),
(3784, ' Libra:Lo que algunos consideran una broma para ti es una falta de respeto. No entres en provocaciones.', '2456756244', 1, '2456756244', 184, 0, 1),
(3785, ' Escorpio: Tu vida necesita un cambio con urgencia, así que no lo aplaces más. Deberías estudiar la posibilidad de cambiarte de ciudad. ', '2456756244', 1, '2456756244', 185, 0, 1),
(3786, 'Sagitario: Eres un ejemplo para los demás porque has luchado mucho para conseguir tus objetivos.', '2456756244', 1, '2456756244', 186, 0, 1),
(3787, ' Capricornio: Cada dolencia o enfermedad tiene unos plazos de recuperación. No trates de apurarlos. ', '2456756244', 1, '2456756244', 187, 0, 1),
